import React from "react";
import Typewriter from "typewriter-effect";

function Type(props) {
  return (
    <Typewriter
      options={{
        strings: [
          `Hello. I’m ${props.name}`,
          '',
          "a Front End Developer",
          "",
          "MERN Stack Developer"
        ],
        autoStart: true,
        loop: false,
        deleteSpeed: 50,
      }}
    />
  );
}

export default Type;
